display:
add this to settings.json
~/.claude/settings.json:

  {
    "alwaysThinkingEnabled": true,
    "spinnerTipsEnabled": false,
    "env": {
      "BASH_DEFAULT_TIMEOUT_MS": "1800000",
      "BASH_MAX_TIMEOUT_MS": "7200000"
    },
    "permissions": {
      "allow": [
        "Read",
        "Write(src/**)",
        "Bash(git *)",
        "Bash(npm *)",
        "Bash(npx *)"
      ],
      "deny": [
        "Read(.env*)",
        "Read(secrets/**)",
        "Write(.env*)"
      ]
    }
  }
